import React from "react";
import { View, Button } from "react-native";

import { Container } from "./styles";

const TodoList = ({ navigation }) => {
  return (
    <Container>
      <h1> Todo List </h1>
      <ul>
        <li>
          {" "}
          <Button title="" onPress={() => navigation.navigate("details")} />
        </li>
      </ul>
    </Container>
  );
};

export default TodoList;
